/**
 * 将汉字转换成全拼
 * @param cn 汉字串
 * @returns 拼音串
 */
ChinesePy.prototype.changeToPy = function(cn){
	var len = cn.length;
	var py = "";
	for(var i = 0; i < len; i++){
		var unicode = window.escape(cn.substring(i,i+1));
		py += this.findPy(unicode);
	}
	return py;
};

/**
 * 查拼音表
 * @param unicode 
 * @returns
 */
ChinesePy.prototype.findPy = function(unicode){
	unicode = unicode.toLowerCase();
	if(unicode.indexOf("u") == -1){
		return window.unescape(unicode);
	}
	var len = this._pinyin.length;
	var code = unicode.replace("%","");
	for(var j = 0; j < len; j++){
		if(this._pinyin[j][1].indexOf(code) != -1){
			return this._pinyin[j][0];
		}
	}
	return window.unescape(unicode);
};

/**
 * 实例ChinesePy类
*/
window.PY = new ChinesePy();